import React from "react";
import UserNaviguation from "../user";
import styled from "@emotion/styled";
import * as theme from "@/commons/styles/theme";
//import { Create } from "@/commons/utils/variants";

const Main = styled.nav((props) => console.log(props), {
  background: "red",
});

function Naviguation() {
  return (
    <Main>
      <UserNaviguation />
    </Main>
  );
}

export default Naviguation;
